import styled from "styled-components";

const Wrapper = styled.div`
display: flex;
padding: 100px 64px ;
`;

const List = styled.ul`
display: flex;
flex-direction: column;
gap: 24px;
margin-left: 0;
margin-bottom: 50px;
`;

const Button = styled.button`
border-radius: 200px;
border: 1px solid var(--load-more-border-color);
padding: 16px 32px;
font-size: 16px;
font-weight: 500;
line-height: 1.5; 
letter-spacing: -0.08px;
`;

export {List, Button}
